⁣
Del libro de John C. Maxwell sobre las leyes del liderazgo hemos extraído 10 claves con una fuerza contundente para trascender en la #EraDigital.⁣
⁣
En época de cambios, hay que recordar al estadista Henry Kissinger, quien explicó que el papel de un líder es llevar a las personas desde donde están hasta donde no han estado.⁣
⁣
Aquí las 10 leyes:⁣
1. La Ley del Tope: el liderazgo determina el límite de tu crecimiento⁣
2. La ley de la influencia: La verdadera medida de tu liderazgo es la influencia.⁣
3. La ley del proceso: El liderazgo se desarrolla poco a poco⁣
4. La ley de la navegación: Cualquiera dirige un barco, un líder define el rumbo⁣
5. La ley de E.F HUTTON: Cuando el verdadero líder habla, las personas escuchan.⁣
6. La Ley del Terreno Firme: La confianza es la base del liderazgo⁣
7. La ley del respeto: Todos siguen naturalmente a líderes más fuertes que ellos mismos.⁣
8. La ley de la intuición: Los lideres evalúan todo según su experiencia⁣
9. La Ley del Magnetismo: tú eres lo que atraes⁣
10. La Ley de la conexión: Los lideres tocan al corazón antes de pedir ayuda.⁣
⁣
En consecuencia, un líder motiva a un equipo alcanzar metas desconocidas y con repercusiones inciertas, pero siempre gratificantes.💥🙌🏻⁣
⁣
Recuerda que los líderes instruyen, así que da el primer paso compartiendo esto.⁣

